import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import { render } from "react-dom";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import App from "./App";
import Nav from "./Nav";

ReactDOM.render(
  <BrowserRouter>
    <Routes>
      <Nav />
      <App />
    </Routes>
  </BrowserRouter>,
  document.getElementById("root")
);
